elements.text:
Очень мудрено. 
С местонахождением:
at - рядом с чем-то (at the table - рядом с этим столом);
on - на поверхности чего-то (on the table - на этом столе);
in - внутри чего-то (in the table - в этом столе).
Есть следующие виды населённых пунктов:
city - город с миллионом жителей и более;
town - город от нескольких сотен жителей до миллиона;
village - деревня, станица, село до двух сотен жителей. 
Со словами city, town и village используется предлог in, ведь итак по этим словам понятно сколько жителей в этих населённых пунктах. 
Но как только вместо этих слов появляются названия этих населённых пунктов, то с названиями city идёт предлог in, а со всеми остальными at. Так слушающий понимает, что речь идёт либо о мегаполисе, либо нет. 
On the beach - на пляже, on the land - на земле, on the floor - на полу, и так далее с остальными словами, обозначающими какие-либо поверхности используется предлог on - в значении на поверхности, как уже говорилось ранее. Но я могу сказать и in the floor, но смысл изменится и будет означать "в полу" (внутри). К примеру a hole in the floor - одна из дырок в этом полу. 
Всё объясняется гораздо проще.
